import { Component, OnInit } from '@angular/core';
import {Observable} from "rxjs";
import {Social} from "../interfaces/social.interface";
import {SocialService} from "../services/social.service";
import {Contact} from "../interfaces/contact.interface";
import {ContactService} from "../services/contact.service";

@Component({
  selector: 'app-social',
  templateUrl: './social.component.html',
  styleUrls: ['./social.component.scss']
})
export class SocialComponent implements OnInit {
  socials : Observable<Social[]> = this.socialService.getSocials();
  contact : Observable<Contact> = this.contactService.getContact();
  base64image = 'data:image/png;base64,';

  constructor(private socialService: SocialService, private contactService: ContactService) { }

  ngOnInit(): void {
  }

  downloadResume() {
    let link = document.createElement('a');
    link.setAttribute('type', 'hidden');
    link.href = 'assets/pdf/Redouan_Tayaa.pdf';
    link.download = 'Redouan_Tayaa_CV.pdf';
    document.body.appendChild(link);
    link.click();
    link.remove();
  }

}
